var request = require("sync-request");

function GetWatchData() {
  return JSON.parse(
    request("GET", "http://localhost:8000/api/home/").getBody()
  )["watch_data"];
}

function GetListenData(sendRequest) {
  if (sendRequest) {
    return JSON.parse(
      request("GET", "http://localhost:8000/api/home/").getBody()
    )["listen_data"];
  }
  return null;
}

export { GetWatchData, GetListenData };
